import {applyMiddleware } from 'redux';
import loggerMiddleware from './loggerMiddleware';
import {configureStore} from "@reduxjs/toolkit";
import {loginSlice} from "./loginSlice";
import {changeName, changeSurname, changeEmail} from "./clientSlice";
import {changeLanguage} from "./languageSlice";
import {login} from "./loginSlice";

const store = configureStore({
    reducer: {
        current_language: changeLanguage,
        current_isLogin: login,
        current_name: changeName,
        current_surname: changeSurname,
        current_email: changeEmail,
    }
});

export default store;
